  true,\n\t\"url\": null,\n\t\"notes\": \"The Academic Libraries Survey, 2006 (ALS:2006),
  is a study that is part of the Academic Libraries Survey (ALS) program. ALS:2006
  (http://nces.ed.gov/surveys/libraries/academic.asp) is a cross-sectional survey
  that summarize services, staff, collections, and expenditures of academic libraries
  in degree-granting postsecondary institutions in the 50 states and the District
  of Columbia. This study provides information pertinent to libraries at degree-granting
  postsecondary educational institutions.\",\n\t\"owner_org\": \"8c0bc869-1189-4ced-af26-2abd2337b886\",\n\t\"extras\":
